import axios from "axios";
import React, { lazy, Suspense, useEffect, useState } from "react";
import { IShipping } from "./interface";
import Pagination from "./Pagination";

const Coin: React.FC = () => {
  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(10);
  const [coinsData, setCoinsData] = useState<IShipping[]>([]);

  const handlePrevPage = (prevPage: number) => {
    setPage((prevPage) => prevPage - 1);
  };

  const handleNextPage = (nextPage: number) => {
    console.log(nextPage);
    setPage((nextPage) => nextPage + 1);
  };

  useEffect(() => {
    console.log("effct");
    let token = localStorage.getItem("id_token");
    // const fetchData = async () => {
    //   const response = await fetch(
    //     `http://localhost:8080/api/user/shipping?page=${page}`
    //   );
    //   const result = await response.json();
    //   console.log(result);
    //   setCoinsData(result);
    //   setTotalPages(totalPages);
    // };
    const fetchData = async () => {
      console.log(localStorage.getItem("id_token"));
      let requestInstance = axios.create({
        headers: {
          Authorization: `${localStorage.getItem("id_token")}`,
        },
      });
      try {
        const response = await requestInstance.get(
          `http://localhost:8080/api/user/shipping?page=${page}`
        );
        setCoinsData(response.data.data);
        setTotalPages(totalPages);
        console.log(response, "111111111111111111111111111111111111111111");
      } catch (error) {
        console.log(error);
      }
    };
    console.log(
      coinsData,
      "===================================================="
    );

    fetchData();
  }, [page]);
  return (
    <>
      <table className="table" width="80%">
        <thead>
          <tr>
            <th>ID</th>
            <th>Size</th>
            <th>Category</th>
            <th>Market Cap</th>
          </tr>
        </thead>
      </table>
      {coinsData.map((coin) => {
        return (
          <div id={String(coin.id)} key={coin.id}>
            <h1>{coin.id} </h1>
          </div>
        );
      })}

      <Pagination
        totalPages={totalPages}
        currentPage={page}
        handlePrevPage={handlePrevPage}
        handleNextPage={handleNextPage}
      />
    </>
  );
};

export default Coin;
